    constructor(props){
        super(props);
        this.state={
            pages:7,
            pagActual:'',
        }

    }

   render(){ 
    return (
        <PDFViewer
            document={{
                url: 'http://localhost:4000/uploads/Limites-Parte 1.pdf',
            }}

            scale={1.2}

            page={this.state.pages}
            pages={this.state.pages}



        />

    )
    }
}


export default LeerLibros
